    // text,
    // image,gif,
    // avatar
    return (
        <div className="post">
           <div className="post__avatar">
                <Avatar src="https://images.unsplash.com/photo-1511367461989-f85a21fda167?ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mnx8cHJvZmlsZXxlbnwwfHwwfHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60" />
            </div> 
            <div className="post__body">
                <div className="post__header">
                    <div className="post__headerTexr">
                        <h3>
                            Christian Vargas 
                            <span>
                                <VerifiedUserIcon className="post_badge"/>
                            </span>
                        </h3>

                    </div>

                    <div className="post__headerDescription">
                        <p>
                            This is dummy text
                        </p>

                    </div>

                    <img  src="https://images.unsplash.com/photo-1511367461989-f85a21fda167?ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mnx8cHJvZmlsZXxlbnwwfHwwfHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60"></img>
                </div>


            </div>

        </div>

    )}

export default Post
